import React from 'react';

export default ({ product }) => {
  const { id, title, description, category, image, price } = product;

  return (
    <div className='card border-dark mb-3' style={{ width: '30%', margin: '10px' }}>
      <img src={image} className='card-img-top' alt='...' />
      <div className='card-body'>
        <h5 className='card-title'>{title}</h5>
        <p>{category}</p>
        <p className='card-text'>{description}</p>
        <h5 className='card-title'>â‚¬{price}</h5>
        <button href={id} className='btn btn-primary' onClick={() => { window.alert('You added' + { title } + 'to your cart' + { id }); }}>Add to cart</button>
        <button type='button' class='btn btn-info btn-lg' data-toggle='modal' data-target='#myModal'>Open Modal</button>
      </div>
    </div>
  );
};
